describtion:
Корпорация WEG основана 16 сентября 1961 году. Изначально занимаясь производством электродвигателей, WEG в 80-х начал расширять ассортимент выпускаемой продукции производством электронных компонентов, промышленной автоматизацией, силовыми и понижающими трансформаторами, жидкими и порошковыми красками и изолирующими лаками.



Производство сконцентрировано на 8 производственных площадках размещенных в Бразилии, трех в Аргентине, двух, в Мексике, одна в Китае и в Португалии.



Купить электродвигатель в г. Краснодаре можно по телефону (861) 292-88-46.





Условные обозначения электродвигателей пример:

Электродвигатель W20 2P 2,2 kW 90L B3T



W20 – тип электродвигателя;



2Р – количество полюсов;



2,2 kW – мощность электродвигателя;



90 – габарит электродвигателя;



L- длина сердечника и/или длина станины;



В3- монтажное исполнение;



Т – клемная коробка смонтирована сверху двигателя.

